import React from "react";
import { Container, Card, CardHeader, Col, Row } from "shards-react";
import formItems from "../../data/form-items";

export default function FormCatalogue() {
  return (
    <Container fluid>
      <Row>
        <Col className="bg-white border-1">
          <Card style={{ boxShadow: "none" }}>
            <CardHeader>
              <h4>Question Banks</h4>
            </CardHeader>
          </Card>

          <Col
            style={{ maxHeight: "70vh", overflowY: "auto", overflowX: "none" }}
          >
            {formItems.map((item, i) => {
              return (
                <FormGroup {...restProps}>
                  <label className="text-muted d-block mb-2">{item.title}</label>
                  <item.component
                    title={item.title}
                    type={item.type}
                    options={item.options}
                    key={`item-${i + 1}`}
                  />
                </FormGroup>
              );
            })}
          </Col>
        </Col>

        <Col className="bg-white" style={{ height: "70vh" }}></Col>
      </Row>
    </Container>
  );
}
